function Cont1() {
  let[contor,setContor]=useState(0);
  let chnge=(props)=>{
    setContor(contor+1)
  }
  return (
    <div className='App'>
      <button onClick={chnge}>click</button>
      <div>{contor}</div>
    </div>
  )
}
export default Cont1
